    updateHeight('100');
  });

  return (
    <div className="container-fluid fullHeight">
      <div className="row align-items-center fullHeight">
        <div className="col-sm">one of three</div>
        <div className="col-sm">one of three</div>
        <div className="col-sm">one of three</div>
      </div>
      <style jsx>{`
        html,
        body {
          height: ${height}%;
        }
        .fullHeight {
          height: ${height}%;
        }
      `}</style>
    </div>
  );
};

export default HomePage;
